import useScript from "/Users/jarvis/Desktop/Porfolio/KESHAV'S portfolio/Portfolio/src/components/script.js";
 <script src="https://cdnjs.cloudflare.com/ajax/libs/gsap/3.12.4/gsap.min.js"
